// export default App;
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './Login'; // Make sure this path is correct
import AdminDashboard from './admin-dashboard'; // Ensure this component exists
import SuperAdminDashboard from './superadmin-dashboard'; // Ensure this component exists
import StudentDashboard from './student-dashboard'; // Ensure this component exists

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/admin-dashboard" element={<AdminDashboard />} />
          <Route path="/superadmin-dashboard" element={<SuperAdminDashboard />} />
          <Route path="/student-dashboard" element={<StudentDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
